import { type } from 'os';
import React from 'react';
import './style.css';

 
interface ButtonProps {
    value: string;
    type: string;
}

const Button: React.FC<ButtonProps> = ({value}) => {
    return (
           <Button type={type} value={value} />
    );
}

export default Button;
